import "../card.css"
import img1 from "../images/account.svg"

export default function Card() {
  return (
    <div className='card'>
      <img src={img1} alt="" />
      <span>Copany</span> <span>New</span> <span>FEATURED</span> <p></p>
      <h4>Position</h4><p></p>

    </div>
  );
}
